// This is the Link API
import React from 'react';

function Header() {
  return (
    <>
      <div className="jumbotron text-center">
        <h1>Welcome to AAIG</h1>
        <p>ALL YOUR FINANCIAL SERVICES NEEDS</p>
        <div className="">
          <img src="/static/logo/aiig_logo.png" />
        </div>
      </div>
      ;
    </>
  );
}

export default Header;
